import styled from 'styled-components';

import mainStyle from '../../styles/main';

const {
	variables: { black },
	device: { mobile },
} = mainStyle;

export const HomeContainer = styled.div`
	width: 25vw;
	height: 100vh;
	background-color: ${black};

	@media ${mobile} {
		position: absolute;
		margin: 0 auto;
		left: 0;
		right: 0;
		width: 80vw;
		height: 80vh;
	}
`;
